import React from 'react';
import './Profile.css'; // Import the CSS file

const Profile = () => {
  const user = JSON.parse(localStorage.getItem('user'));

  // Check if user data is available
  if (!user) {
    return (
      <div className="profile-container">
        <h2 className="profile-title">Profile Page</h2>
        <div className="profile-content">User data not available. Please log in.</div>
      </div>
    );
  }

  const handleEditClick = () => {
    console.log('Edit button clicked');
  };

  return (
    <div className="profile-container">
      <h2 className="profile-title">Profile</h2>
      <div className="profile-info">
        <div className="profile-field">
          <label className="profile-label">First Name:</label>
          <div className="profile-value">{user.firstName}</div>
        </div>
        <div className="profile-field">
          <label className="profile-label">Last Name:</label>
          <div className="profile-value">{user.lastName}</div>
        </div>
        <div className="profile-field">
          <label className="profile-label">Email:</label>
          <div className="profile-value">{user.email}</div>
        </div>
        <div className="profile-field">
          <label className="profile-label">Phone Number:</label>
          <div className="profile-value">{user.phoneNo}</div>
        </div>
      </div>

      <button className="profile-button" onClick={handleEditClick}>
        Edit Profile
      </button>
    </div>
  );
};

export default Profile;
